        {name: grupoF[1], pontos: c.pontosF2, sg: c.sg_F2},
        {name: grupoF[2], pontos: c.pontosF3, sg: c.sg_F3},
        {name: grupoF[3], pontos: c.pontosF4, sg: c.sg_F4},
    ]
    classificacaoF.sort(function (a,b) {
        if (b.pontos != a.pontos) {    
